import React from "react";
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';

const Names = ({ setForm, formData }) => {
  const { firstName, lastName, nickName } = formData;

  return (
    <div className="form">
      <TextField
        label="First Name"
        name="firstName"
        value={firstName}
        onChange={setForm}
      />
      <TextField
        label="Last Name"
        name="lastName"
        value={lastName}
        onChange={setForm}
      />
      <TextField
        label="Nick Name"
        name="nickName"
        value={nickName}
        onChange={setForm}
      />
      <div>
        <Button onClick={next}>Next</Button>
      </div>
    </div>
  );
};

export default Names;
